import React from "react";
import { render } from "react-dom";
import { BrowserRouter as Router } from "react-router-dom";
import App from "./App";
render(
  <Router>
    <App />
  </Router>,
document.getElementById("root"));
ReactDOM.render(<App />, document.querySelector('#root'));
